// ConditionCheck.ts
export class ConditionCheck {
    constructor(value1, condition, value2) {
        this.value1 = value1;
        this.condition = condition;
        this.value2 = value2;
    }
    toJSON() {
        return {
            value1: this.value1,
            condition: this.condition,
            value2: this.value2,
        };
    }
}
